import React from "react";
import Header from "./components/Header";
import Footer from "./components/Footer";
import WeaponList from "./components/WeaponList";
import { Card } from "@mui/material";

function App() {
  return (
    <div>
      <Header />
      <Card
        sx={{
          marginTop: "20px",
          marginBottom: "20px",
          padding: "20px",
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
        }}
      >
        <WeaponList />
        <WeaponList />
      </Card>
      <Footer />
    </div>
  );
}

export default App;
